import React from 'react';
import './CryptoAssets.css';

function CryptoAssets() {
  return (
  <>
<div className='asset__container'>
  <div className='asset__content'>
<h2>Crypto Assets</h2>
<img src='images/cryptoasset1.svg' alt='cryptoasset' className='asset__container-logo' />
<img src='images/cryptoasset2.svg' alt='cryptoasset' />
</div>
</div>
  </>
  )
}

export default CryptoAssets;
